import { Route, Switch, Redirect } from 'react-router-dom';

import HomePage from './pages/HomePage';
import Layout from './components/layout/Layout';

function App() {
  return (
    <Layout>
      <Switch>
        <Route path='/' exact>
          <Redirect to='/homepage' />
        </Route>

        {/* <Route path='/quotes/:quoteId'>
          <QuoteDetail />
        </Route> */}  
        {/* <Route path='*'>
          <NotFound />
        </Route> */}
      </Switch>
    </Layout>
  );
}

export default App;
